import './App.css';
import Home from './components/home/home.component';
import { Provider } from 'react-redux'
import store from './store'

const App = () => {

  return (
      <Provider store={store}>
        <GlobalStyle>
          <Home/>
        </GlobalStyle>
      </Provider>
  );

}
export default App;
